import React from 'react';
import { Routes, Route } from 'react-router-dom';
// import useDocumentTitle from './useDocumentTitle'

import './App.css';

// import Categories from './pages/Categories/index';
import Pages from './pages/index';

import CategoryData from './data/categories';

// function Page(props) {
//   useDocumentTitle(`Agriché - ${props.title}`);
//   return props.content;
// }

function App() {
  return (
      <Routes>
        <Route key="allproducts" exact path="/" element={<Pages url='allproducts' data={CategoryData} allCategory={true} title='Semua Produk' />} />
        {/* <Route path="/kategori" element={<Page content={<Categories />} title='Kategori' />} /> */}
        {/* Kategori */}
        {
          CategoryData.map(sub => (
            <Route key={sub.url} path={"/kategori/" + sub.url} element={<Pages name={sub.name} url={"kategori/" + sub.url} data={sub.data} allCategory={false} title={sub.name} />} />
          ))
        }
      </Routes>
  );
}

export default App;
